css:
@-moz-document url-prefix("https://mspfa.com/") {
body {
    background-color: #535353;
    color: #FFFFFF;
}
#main {
    background-color: #393939;
}
#flashytitle {
    background-color: #111111;
}
nav {
    background-color: #000000;
    color: #000000;
}
nav .heart {
    background-image: url("http://mspfa.com/images/candyheart.png");
}
#dialog {
    background-color: #111111;
}
#dialog > div:nth-child(1) {
    background-color: #393939;
}
.mspfalogo {
    border-right-color: #474747;
    background-color: #111111;
}
table.container {
    border-color: #393939;
    background-color: #111111;
}
table.container > tbody > tr > td,
table.container > tbody > tr > th {
    border-color: #393939;
}
#slide {
    background-color: #111111;
}
#info > span > .spoiler.open {
    background-color: #111111;
}
span {
    color: #FFFFFF;
}

td {
    color: #FFFFFF;
}
}
